import React from 'react';
import Profile from "../Profile/Profile";

const Main = () => {
    return (
        <main className="content">
            <Profile avatar='https://mobimg.b-cdn.net/v3/fetch/a5/a572284e28c5218a3ee631c937be827c.jpeg' name='Даниил'
                     about='Drug addict'/>
        </main>
    );
};

export default Main;
